import React from 'react'
import AllExpenseDetails from './AllExpenseDetails'

function AllExpense(props){
    const expensesOwe = props.expenses.map(item=>{
        var month = item.time.substr(4,4);
        var date = item.time.substr(7,4);

        return <AllExpenseDetails description={item.description} lent="you lent " paid="you paid " name={item.name} amount={item.amount} monthOf={month} dateOf={date}/>
    })
    const expensesYouOwe = props.expensesYouOwe.map(item=>{
        return <AllExpenseDetails description={item.description} lent="lent you " paid=" paid " name={item.name} amount={item.amount} time={item.time}/>
    })
    return(
        <div className="recent-activity-overflow">
            {expensesOwe}
            {expensesYouOwe}
        </div>
    )
}

export default AllExpense
